import React from 'react';
import {useSelector} from "react-redux";
import CardCart from "../card/CardCart";

const CardCartList = ({cart}) => {

    return (
        <div>
            {cart.map(element => <CardCart props={element}/>)}
        </div>
    );
};

export default CardCartList;
